import "./CostItem.css";

function CostItem({ item }) {
  const { name, date, price } = item;

  return (
    <div className="container">
      <h1 className="title">{name}</h1>
      <p className="date">{date}</p>
      <p className="price">{price}</p>
    </div>
  );
}

export default CostItem;
